import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

function Home() {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col xs lg="6">
          <Card className="mt-5">
            <Card.Body>
              <Card.Title className="text-center">
                <h1>My Logo</h1> {/* 로고 텍스트 */}
              </Card.Title>
              <Card.Title>My Web Page</Card.Title> {/* 웹 페이지 제목 */}
              <Card.Text>
                This is my web page. It's awesome. {/* 부가 설명 */}
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
